import React from 'react';
import './Prices.css';

function Prices() {
  const plans = [
    { name: 'Basic', price: '$99/month', features: ['5 Projects', 'Basic Support'] },
    { name: 'Pro', price: '$199/month', features: ['10 Projects', 'Priority Support', 'Analytics'] },
    { name: 'Enterprise', price: '$499/month', features: ['Unlimited Projects', 'Dedicated Support'] },
  ];

  return (
    <div className="prices">
      <h1>Our Pricing Plans</h1>
      <div className="plan-cards">
        {plans.map((plan, index) => (
          <div className="card" key={index}>
            <h2>{plan.name}</h2>
            <p className="price">{plan.price}</p>
            <ul>
              {plan.features.map((feature, i) => (
                <li key={i}>{feature}</li>
              ))}
            </ul>
            <button className="cta-btn primary">Choose Plan</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Prices;
